import { Link } from "react-router-dom";

function PageHeader() {
  return (
    <header>
      <span className="page-header__logo">0_0</span>
      <nav>
        <Link to="/">Home</Link> | <Link to="/quiz">Quiz</Link> |{" "}
        <Link to="/about">About</Link> | <Link to="/demos">Demo</Link>
      </nav>
    </header>
  );
}

export default PageHeader;
